import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import { CartProvider } from './context/CartContext';
import Navbar from './components/Navbar';

import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import Cart from './pages/Cart';
import Checkout from './pages/Checkout';
import Success from './pages/Success';
import Cancel from './pages/Cancel';
import Orders from './pages/Orders';
import PrivateRoute from './components/PrivateRoute';
import AdminRoute from './components/AdminRoute';

import GameDetail from './pages/GameDetail';
import AdminCreateGame from './pages/AdminCreateGame';
import AdminEditGame from './pages/AdminEditGame';
import AdminGameList from './pages/AdminGameList';

import ForgotPassword from './pages/ForgotPassword';     
import ResetPassword from './pages/ResetPassword';        
import VerifyEmail from './pages/VerifyEmail';           

import Config from './pages/Config'; // âœ… Importata la nuova pagina

function App() {
  return (
    <AuthProvider>
      <CartProvider>
        <BrowserRouter>
          <Navbar />
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/games/:id" element={<GameDetail />} />

            <Route path="/forgot-password" element={<ForgotPassword />} />
            <Route path="/reset-password" element={<ResetPassword />} />
            <Route path="/verify-email" element={<VerifyEmail />} />

            {/* âœ… Pagina configurazione utente */}
            <Route
              path="/config"
              element={
                <PrivateRoute>
                  <Config />
                </PrivateRoute>
              }
            />

            <Route
              path="/admin/create-game"
              element={
                <AdminRoute>
                  <AdminCreateGame />
                </AdminRoute>
              }
            />
            <Route
              path="/admin/edit-game/:id"
              element={
                <AdminRoute>
                  <AdminEditGame />
                </AdminRoute>
              }
            />
            <Route
              path="/admin/games"
              element={
                <AdminRoute>
                  <AdminGameList />
                </AdminRoute>
              }
            />

            <Route
              path="/cart"
              element={
                <PrivateRoute>
                  <Cart />
                </PrivateRoute>
              }
            />
            <Route
              path="/checkout"
              element={
                <PrivateRoute>
                  <Checkout />
                </PrivateRoute>
              }
            />
            <Route
              path="/success"
              element={
                <PrivateRoute>
                  <Success />
                </PrivateRoute>
              }
            />
            <Route
              path="/cancel"
              element={
                <PrivateRoute>
                  <Cancel />
                </PrivateRoute>
              }
            />
            <Route
              path="/orders"
              element={
                <PrivateRoute>
                  <Orders />
                </PrivateRoute>
              }
            />
          </Routes>
        </BrowserRouter>
      </CartProvider>
    </AuthProvider>
  );
}

export default App;
